description:
The Incredible Hands

Culture Documentary hosted by Chris Kent, published by NHK broadcasted as part of NHK Tsukiji :World's Largest Fish Market series in 2009 - English narration


Information
------------------------------

)t is not just an ordinary fish market. It is the BIGGEST in the world with a traffic of 100,000 people going in and out of 850 stalls. 50,000 tons of fish is traded daily with hundreds of millions of dollars changing hands. Its famous auctions have attracted millions of tourists worldwide. But what lies beneath the surface of this amazing market?
This episode is a visual feast of never -before -filmed sequences on how a 300-kg tuna is cut, and all the the unique skills of the fishmongers and the myriad varieties of seafood available

